const styles = theme => ({
    wlcm:{
        fontWeight: 700,
        fontSize: 38,
        fontFamily: 'roboto',
        padding: '10%',
        marginRight: '10%'
    },
    wlmWrapper:{
        alignItems: 'center',
        justifyContent: 'center',
        display: 'flex',
    },
    wlcmTabs:{
        position: 'absolute',
        paddingTop: '10%'
    }
    
})
export default styles;
